// SPDX-License-Identifier: GPL-3.0-or-later
// @taki
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "../interfaces/IOTC.sol";
import "../interfaces/IVault.sol";

contract OTC is IOTC, Ownable {
    IVault private vault;
    bool public subscribable;
    bool public redeemable;

    constructor(IVault _vault) {
        // 先部署vault，再部署场外交易合约
        vault = _vault;
    }

    // 申购
    function subscribe(IERC20 token, uint256 _amount) external override {
        // 检查是否允许申购
        require(subscribable, "OTC: currently unsubscribed");
        // 收款到vault
        token.transferFrom(msg.sender, address(vault), _amount);
        // TODO 计算价格
        // 发送代币
        vault.transferF(msg.sender, _amount);
    }

    // 赎回
    function redeem(IERC20 token, uint256 _amount) external override {
        // 检查是否允许赎回
        require(redeemable, "OTC: currently not convertible");
        // 收款到F
        // vault.f.transferFrom(msg.sender, address(vault), _amount);
        vault.f().burn(msg.sender, _amount);
        // TODO 计算价格
        // 发送代币
        vault.transferToken(token, msg.sender, (_amount * 99) / 100);
    }

    // 开放申购
    function openSubscribe() public onlyOwner {
        subscribable = true;
    }

    // 开放赎回
    function openRedeem() public onlyOwner {
        redeemable = true;
    }

    // 关闭申购
    function closeSubscribe() public onlyOwner {
        subscribable = false;
    }

    // 开放赎回
    function closeRedeem() public onlyOwner {
        redeemable = false;
    }
}

contracts/core/Panel.sol.content:
// SPDX-License-Identifier: GPL-3.0-or-later
// @taki
pragma solidity ^0.8.0;
// 最终希望把所有的Owner转移到这个面板上，统一操作会比较好

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "../interfaces/IVault.sol";
import "../interfaces/IOTC.sol";
import "../interfaces/IPools.sol";
import "../interfaces/IPurchase.sol";

contract Panel is Ownable {
    IVault vault;
    IOTC otc;
    IPools pools;
    IPurchase purchase;

    constructor(IVault _vault, IOTC _otc, IPools _pools, IPurchase _purchase) {
        // 最后部署面板合约
        vault = _vault;
        otc = _otc;
        pools = _pools;
        purchase = _purchase;
    }

    // example 操作开放申购: otc开放申购，vault给token授权

    // 开放申购
    // @xiaochen
    function otc_openSubscribe() public onlyOwner {
        otc.openSubscribe();
    }

    // 开放赎回
    // @xiaochen
    function otc_openRedeem() public onlyOwner {
        otc.openRedeem();
    }

    // 关闭申购
    // @xiaochen
    function otc_closeSubscribe() public onlyOwner {
        otc.closeSubscribe();
    }

    // 关闭赎回
    // @xiaochen
    function otc_closeRedeem() public onlyOwner {
        otc.closeRedeem();
    }

    // vault给token授权
    // @xiaochen
    function vault_authorizePermit(
        IERC20 token,
        address account
    ) public onlyOwner {
        vault.authorizePermit(token, account);
    }

    // vault取消token授权
    // @xiaochen
    function vault_revokePermit(
        IERC20 token,
        address account
    ) public onlyOwner {
        vault.revokePermit(token, account);
    }

    // example 操作创建pool: pool创建，vault给token授权

    // 创建pool
    // @xiaochen
    function pools_create(
        IERC20 token,
        uint256 _amount,
        uint256 _f_amount,
        uint256 _feeRate
    ) public onlyOwner {
        pools.createLiquidity(token, _amount, _f_amount, _feeRate);
    }

    // 销毁pool
    // @xiaochen
    function pools_destroy(IERC20 token) public onlyOwner {
        pools.destroyLiquidity(token);
    }
}

